function loadLegends(){legendsList.forEach(n=>{const a=`<div class="carousel-item col-md-4${n.isActive?" active":""}">\n            <div class="card">\n            <div class="img-thumbnail">\n                <a class="text-warning" target="_blank" href="${n.link}">\n                    <img src="${n.img}" alt="Cadejo" class="cards-row">\n                    <div class="caption">\n                        <p>${n.title}</p>\n                    </div>\n                </a>\n            </div>\n            </div>\n        </div>`;$("#divLegends").append(a)})}loadLegends();